Set of Nunchuks: just a really cool set of metal chucks;
Very cool, real machined metal (I believe hardened steel just like an ASP baton) EXPANDING NUNCHUKS. These are a solid impact weapon not fakes or foam trainers. IT IS SOLID AND WELL MADE. Expanding baton sections are connected by a heavy chromed chain. When retracted the entire set fits into a belt pouch that isn't much bigger than a large folding knife sheath. I have trained with numerous weapons and firearms, but this isn't something practical for me. Just a very cool item that someone into martial arts may want. Unknown make or vitage, but I can tell that this is a solid quality item that should not be considered a toy. Open to reasonable offers or trades for gun gear. $30 includes standard shipping.

*The nunchaku is a weapon used in Okinawan Kobudo. Under Japanese rule in the early 17th century the people of Okinawa were not allowed to own weapons. In response, the people learned empty fist fighting and created weapons out of household implements. Fighting arts revolving around a staff (bo), the handle of a millstone (tonfa), a sickle (kama) developed. The bit used for horses was two sticks tied together with a string. That simple device became the weapon we now call nunchucks. *
